Mega Trucks

Technology Documentary hosted by William Hootkins, published by Discovery Channel broadcasted as part of DC Extreme Machines series in 1997 - English narration


Information
------------------------------

Extreme Machines is dedicated to finding out how machines work. Trucks are unquestionably the giants of the road. In this episode we take a look of mega trucks, automotive behemoths which see service in all manner of situations from transporting goods to racing and stunt-driving. Everything we consume is at some stage transported by a truck, but we see also the thrill of truck racing and the worlds fastest truck.

